import { ActionType } from "../contanst/action-type";

export const setDatas = (datas) => {
  return {
    type: ActionType.GET_DATA,
    payload: datas,
  };
};

export const postDatas = (request) => {
    return function (dispatch) {
        return setDatas().then((res) =>{
            console.log
          dispatch  ({
              type: ActionType.POST_DATA,
            payload: res.data,
          })
        }) 
    }

};
